import React, { useState } from 'react';
import AddUser from './components/User/AddUser';
import UsersList from './components/User/UsersList';

function App() {
  const [usersList, setusersList] = useState([]);

  return (
    <div>
      <AddUser />
      <UsersList users={[usersList]} />
    </div>
  );
}

export default App;
